bool ShaderDesc::IsShaderVersionSupported(ShaderVersion ver)
{
    switch(ver)
    {
        case ShaderVersion_GLES100_NDL: return true;
        case ShaderVersion_GLES: return true;
        case ShaderVersion_GLES30: return true;
        default: return false;
    }
};

