const FragShaderDesc* FragShaderDesc::GetDesc(ShaderDesc::ShaderType shader, ShaderDesc::ShaderVersion ver)
{
    return Descs[GetShaderIndex(shader, ver)];
};

FragShaderDesc::ShaderIndex FragShaderDesc::GetShaderIndex(ShaderDesc::ShaderType shader, ShaderDesc::ShaderVersion ver)
{
    ShaderDesc::ShaderIndex index = ShaderDesc::GetShaderIndex(shader);
    int shaderVersionIndex = ShaderVersionIndex[ver];
    SF_DEBUG_ASSERT1(shaderVersionIndex >= 0, "ShaderVersion did not have support compiled in (%d)", ver);
    if (shaderVersionIndex < 0) shaderVersionIndex = 0;
    return ShaderIndexingData[index][shaderVersionIndex]. FragIndex;
};

FragShaderDesc::ShaderIndex FragShaderDesc::GetShaderIndex(ShaderDesc::ShaderIndex shader, ShaderDesc::ShaderVersion ver)
{
    int shaderVersionIndex = ShaderVersionIndex[ver];
    SF_DEBUG_ASSERT1(shaderVersionIndex >= 0, "ShaderVersion did not have support compiled in (%d)", ver);
    if (shaderVersionIndex < 0) shaderVersionIndex = 0;
    return ShaderIndexingData[shader][shaderVersionIndex]. FragIndex;
};

